from dataclasses import dataclass

@dataclass
class Triple:
    subject: str
    predicate: str
    object: str

# EVOLVE-BLOCK-START

def predict(triples: list[Triple]) -> str:
    predicate_templates = {
        "cityServed": "{subject} serves the city of {object}.",
        "elevationAboveTheSeaLevel": "{subject} is {object} metres above sea level.",
        "location": "{subject} is located in {object}.",
        "operatingOrganisation": "{subject} is operated by {object}.",
        "runwayLength": "{subject} has a runway length of {object} metres.",
        "runwayName": "{subject} has the runway name {object}.",
        # Add more predicate templates as needed
    }

    sentences = []
    for triple in triples:
        if triple.predicate in predicate_templates:
            sentence = predicate_templates[triple.predicate].format(subject=triple.subject, object=triple.object)
        else:
            sentence = f"The {triple.predicate} of {triple.subject} is {triple.object}."
        sentences.append(sentence)
    return ". ".join(sentences) + "."

